import logo from './logo.png';
import './App.css';
import $ from 'jquery';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button class="clicker">
          <img src={logo} className="App-logo" alt="logo" />
        </button>
      </header>
    </div>
  );
}

$('.clicker').click(function(){
  $(this).next('.App-logo').toggleClass('paused');
});

export default App;
